@import "./pallete.scss";

$breakpoint-tablet: 768px;
$breakpoint-desktop: 1024px;

body {
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 0;
  margin: 0;
  color: $base-color;
  font-family: "Roboto";
  position: relative;
  width: 100%;
}

.header {
  display: flex;
  padding: 16px 4px;
  width: 95%;
  @media (min-width: $breakpoint-tablet) {
    width: 80%;
  }
  @media (min-width: $breakpoint-desktop) {
    width: 60%;
  }
}

.carousel {
  position: relative;
  width: 100%;
  border-bottom: 3px solid $base-color;
  overflow: hidden;
  @media (min-width: $breakpoint-desktop) {
    width: 84%;
  }

}
.carouselContainer{
  display: flex;
